import React from 'react';


var SignInForm = (props) => {
    return (
        <form>
            <label>
                Name:
                <textarea id='name' rows='1' cols='20'/>
            </label>
            <br/>
            <label>
                Email:
                <textarea id='email' rows='1' cols='20'/>
            </label>
            <br />
            <label>
                Password:
                <textarea id='password' rows='1' cols='20'/>
            </label>
        </form>
    );

}

export default SignInForm;
